import React, { Component } from "react";
import { WiThermometer, WiNightSnow } from "react-icons/wi";
import { MdDashboard } from "react-icons/md";
import { FaMapMarkerAlt } from "react-icons/fa";
import { VscCalendar } from "react-icons/vsc";
import { MdSettings } from "react-icons/md";
import { IoMdStats } from "react-icons/io";
import { ProgressBar } from "react-bootstrap";

const now = 70;
const precipitation = 25;

const progressInstance = (
  <ProgressBar now={now} variant="warning" className="pt w-75 ml-4" />
);

const precipitationInstance = (
  <ProgressBar now={now} variant="warning" className="pt w-75 ml-4" />
);

class Amenu extends Component {
  render() {
    return (
      <div className="amenu ">
        <div className="tests ml-3">
          <h5 className="meteoText my-4">
            <WiThermometer className="thermo-size" />
            METEOROLOG
          </h5>
        </div>
        <hr className="hr mb-5" />
        <section>
          <div className="test">
            <MdDashboard className="amenu-size my-1 ml-4" />
            <p className="ml-3 my-2">Dashboard</p>
          </div>
          <div className="test">
            <IoMdStats className="amenu-size my-1 ml-4" />
            <p className="ml-3 my-2">Statistics</p>
          </div>
          <div className="test">
            <FaMapMarkerAlt className="amenu-size my-1 ml-4" />
            <p className="ml-3 my-2">Map</p>
          </div>
          <div className="test">
            <VscCalendar className="amenu-size ml-4 my-1" />
            <p className="ml-3 my-2">Calendar</p>
          </div>
          <div className="test">
            <MdSettings className="amenu-size my-1 ml-4" />
            <p className="ml-3 my-2">Setting</p>
          </div>
        </section>
        <div className="favorite">
          <div className="meteo-favo text-justify d-flex justify-content-center">
            <WiNightSnow className="amenu-sizes text-primary my-3" />
            <p className="p-3">
              Today
              <br />
              <small>11:44</small>
              <br />
              <small>Mon, 11 January</small>
            </p>
          </div>
          <div className="dp text-center">
            <h2>+4°C</h2>
            <h5>
              New York <br />
              <small className="hit">United States</small>
            </h5>
          </div>
          <div className="humi">
            <small className="hit ml-4">Humidite </small>
            <small className="ml-5">70%</small>
            {progressInstance}
          </div>
          <div className="humi">
            <small className="hit ml-4">Precipitation</small>
            <small className="ml-5">25%</small>
            {precipitation}
          </div>
        </div>
      </div>
    );
  }
}

export default Amenu;
